(4, '6', 'The engineer and society', 'Apply reasoning informed by the contextual knowledge to assess societal, health, safety, legal and cultural issues and the consequent responsibilities relevant to the professional engineering practice.'),
(4, '7', 'Environment and sustainability', 'Understand the impact of the professional engineering solutions in societal and environmental contexts, and demonstrate the knowledge of, and need for sustainable development.'),
(4, '8', 'Ethics', 'Apply ethical principles and commit to professional ethics and responsibilities and norms of the engineering practice.'),
(4, '9', 'Individual and team work', 'Function effectively as an individual, and as a member or leader in diverse teams, and in multidisciplinary settings.'),
(4, '10', 'Communication', 'Communicate effectively on complex engineering activities with the engineering community and with society at large, such as, being able to comprehend and write effective reports and design documentation, make effective presentations, and give and receive clear instructions.'),
(4, '11', 'Project management and finance ', 'Demonstrate knowledge and understanding of the engineering and management principles and apply these to ones own work, as a member and leader in a team, to manage projects and in multidisciplinary environments.'),
(4, '12', 'Life-long learning', 'Recognize the need for, and have the preparation and ability to engage in independent and life-long learning in the broadest context of technological change.');

